import { Component } from 'react'
import './Header.css'

class Header extends Component {
  render() {
    return (
      <header className="header">
        <nav className="navMenu">
          <a href="#">Home</a>
          <a href="#">Blog</a>
          <a href="#">Work</a>
          <a href="#">About</a>
          <div className="dot"></div>
        </nav>
      </header>
    )
  }
}

export { Header }
